import React from "react";
import "../../App.css";
import "../Image.css";

function About() {
  return (
    <div>
      <img
        className="photo-sample"
        src="/images/Profile.jpg"
        alt="/images/Profile.jpg"
      />
      <p className="intro-text">
        <strong>Min Goo Choi</strong>
      </p>
      <p className="intro-text">
        <strong>mingoo.choi@berkeley.edu</strong>
      </p>
      <p className="intro-text">
        <strong>Education: </strong>I am currently pursuing a Bachelor's Degree
        in Computer Science at University of California, Berkeley
      </p>
    </div>
  );
}

export default About;
